import React from 'react';
import {
  Card, CardImg, CardText, CardBody,
  CardTitle, CardSubtitle, Button
} from 'reactstrap';
import { Container, Row, Col } from 'reactstrap';

const Boxes = (props) => {
  return (
    <div className="container-fluid" style={{marginTop: '60px',display:'grid', gridGap: '0', justifyItems:'center', width:'1200px'}}>
    <Row>
      <Col >
        <CardImg style={{width:'350px', height:'300px'}} src="/static/images/3.png" />
        <Card style={{width:'300px', height:'190px'}} body>
          <CardTitle>Special Title Treatment</CardTitle>
          <CardText>With supporting text below as a natural lead-in to additional content.</CardText>
          <Button>Go somewhere</Button>
        </Card>
      </Col>

      <Col >
        <CardImg style={{width:'350px', height:'300px'}} src="/static/images/1.png" />
        <Card style={{width:'300px', height:'190px'}} body>
          <CardTitle>Special Title Treatment</CardTitle>
          <CardText>With supporting text below as a natural lead-in to additional content.</CardText>
          <Button>Go somewhere</Button>
        </Card>
      </Col>

      <Col >
        <CardImg style={{width:'300px', height:'300px'}} src="/static/images/2.png" />
        <Card style={{width:'300px', height:'190px'}} body>          
          <CardTitle>Special Title Treatment</CardTitle>
          <CardText>With supporting text below as a natural lead-in to additional content.</CardText>
          <Button>Go somewhere</Button>
        </Card>
      </Col>
  </Row>
  </div>
  );
};

export default Boxes;
